        raise TypeError("Input must be a sequence of characters.")
    n = len(s)
    if n < 0:
        raise ValueError("Length of s must be non-negative.")
    valid = {'I', 'V', 'X', 'L', 'C', 'D', 'M'}
    for i in range(n):
        c = s[i]
        if c not in valid:
            raise ValueError(f"Invalid Roman numeral character: {c}")
    # Roman numeral values
    values = {'I': 1, 'V': 5, 'X': 10, 'L': 50,
              'C': 100, 'D': 500, 'M': 1000}
    res = 0
    i = 0
